Hey Canna Fam! Please report this to IG for me! It takes several complaints to get a scammer account shut down, I’m learning now. Please report, post, tag and share. The fake account is: 

@ imperiouscannabis_ (report w no spaces, has to have a space now) 🤓

My good account is: @imperiouscannabis 
please don’t accidentally report the good account. Lol! 

Norty needs y’all’s help! I’ve got a fake-ass imposter stealing my images, logos, and pretending to be me! The fakery gets worse because they are pretending to giveaway prizes that don’t exist, and they are asking for peoples CashApp & other accounts so they can rip them off! 

I just started doing legit giveaways myself! And it’s going great! Now this ass-clown! Lmao! 

Here’s the deal, they blocked me, so I’m asking if you have a little time will someone please report this fugazzi? The fake account is: @ImperiousCannabis_

My real account is: @ImperiousCannabis 
Please don’t accidentally report me on the good account! Lmao! Thx! Norty

